import { ITimberLog } from "@timberio/types";
/**
 * tries to process logs maximum 3 times in case of server error.
 *
 * @param fn - (logs: ITimberLog[]) => Promise<ITimberLog[]>
 */
export default function makeRetry(fn: (logs: ITimberLog[]) => Promise<ITimberLog[]>): Promise<(logs: ITimberLog[]) => Promise<ITimberLog[]>>;
